import React from 'react'
import worshipHands from '../../assets/worshipHands.jpg';

export const Home = () => {
    return (
        <div className="container">
            <div className="jumbotron text-center">
                <img src={worshipHands} class="img-fluid" alt="Responsive image">

                </img>
            </div>

        </div>
    )
}
